export default function Informatique() {
	return (
		<span>
			Je découvre <f>régulièrement</f> de <f>nouveaux langages</f> de 
			<br />programmation à travers des <f>miniprojets</f> personnels ou pour
			des proches.
			<br />
			<br />
			Je passe une grande partie de mon temps libre à coder ou à apprendre à coder.
		</span>
	);
}
